// import "bulma/css/bulma.css";
import Link from "next/link";

function App({ Component, pageProps }) {
  return (
    <>
      <Link href="/">
        <a>Home</a>
      </Link>
      <Link href="/about">
        <a>About</a>{" "}
      </Link>
      <Link href="/contact">
        <a>Contact</a>{" "}
      </Link>
      <Component {...pageProps} />
    </>
  );
}

export default App;
